public boolean isConfiguredResourceName(String resourceName) {
  // check configured
  Map<String, ResourceInformation> configuredResourceTypes =
      ResourceUtils.getResourceTypes();
  if (!configuredResourceTypes.containsKey(resourceName)) {
    return false;
  }
  return true;
}
